<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>数据结构</title>
    <script>
        var f = () => 5;
        // 等同于
        var f = function () { return 5 };

        var sum = (num1, num2) => num1 + num2;
        // 等同于
        var sum = function(num1, num2) {
            return num1 + num2;
        };
    </script>
</head>
<body>


</body>
</html>
